import React, { Component } from "react";

export const sname = "Raj";

class Hero extends Component {
  render() {
    const mname = "Prakash";
    const lname = "Pande";
    const email = "rpande400@gmail.com";

    return (
      <div>
        <h3>Name: {sname} {mname} {lname}</h3>
        <p>Email: {email}</p>
        <p>Phone: 1234567890</p>
        <p>Address: ABC, xyz street.</p>
      </div>
    );
  }
}

export default Hero;
